import React from 'react';
import { Timeline } from 'react-twitter-widgets'
import './suport.css'
const Suport = (props) => {
  return (
    <div className ="twitter">
      <Timeline
        dataSource={{
          sourceType: 'elpitters2',
          screenName: 'CriptoNoticias'
        }}
        options={{
          username: 'elpitters2',
          height: '800',
          width: '400'
        }}
        onLoad={() => console.log('Timeline is loaded!')}
      />
    </div>
  )
}

export default Suport;
